import React from 'react'
import {Card} from 'antd';

const {Meta} = Card


function CardMessage(props) {

    return (
        <Card
        style={{ width: 300 }}
        hoverable="true"
        cover={<img
            alt={props.cardInfo.fields.description.stringValue}
            src={props.cardInfo.fields.image.stringValue}
           />}
        actions={[
            <a target="_blank" rel="noopener noreferrer" href={props.cardInfo.fields.link.stringValue}>
                <img alt={props.cardInfo.fields.description.stringValue}
                src={props.cardInfo.fields.image.stringValue}/>
            </a>
        ]}
    >
        <Meta
            title={props.cardInfo.fields.description.stringValue}
        />

    </Card>
    )
}

export default CardMessage
